import HeaderNavBar from "./components/HeaderNavbar";
import HomePage from "./pages/HomePage";
import { Container, Row } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

const App = () => {
  return (
    <Container style={{ minHeight: "100vh" }}>
      <Row>
        <HeaderNavBar />
      </Row>
      <Row>
        <HomePage />
      </Row>
    </Container>
  );
};

export default App;
